import { useRef, useState } from "react"
import { useDispatch, useSelector } from "react-redux"
import { updateUser } from "../../features/updateSlice"
import { Navigate } from 'react-router-dom'

function Profile(){   
    const [firstName, setFirstName] = useState("")
    const [lastName, setLastName] = useState("")
    const [edit, setEdit] = useState(false)
    const state = useSelector(state => state)
    const user = useSelector(state => state.user)
    const update = useSelector(state => state.update)


    const updatedFirstName = useRef(update.firstName)
    updatedFirstName.current = update.firstName
    const updatedLastName = useRef(update.lastName)
    updatedLastName.current = update.lastName
    //console.log('update is : ',update)
    //console.log('user is : ',user)
    const dispatch = useDispatch()
    function handleEdit(e){
        setEdit(true)
    }
    function amar(){
    //console.log('update is : ',update)
    /* let name = document.getElementById('name')
    name.innerHTML = firstName+" "+lastName */
    /* dispatch({
        type: "user/update",
        payload: {firstName: "toto", lastName: "toz"}
    }) */
    /* console.log("toz is: ",update.firstName, update.lastName)
    console.log("user reducer state is: ", user) */

    }
    function updateForm(e){
        e.preventDefault()
        dispatch(updateUser({firstName: firstName, lastName: lastName}))
        setEdit(false)
        console.log("im waiting 1")
        setTimeout(function(){
            dispatch({
                type: "user/update",
                payload: {firstName: updatedFirstName.current, lastName: updatedLastName.current}
            })

        }, 100)
        console.log("im waiting 2")
    }

    function checkstate(){
        //console.log(state)
        /* dispatch({
            type: "user/update",
            payload: {firstName: update.firstName, lastName: update.lastName}
        }) */
    }

    function cancelForm(e){
        setEdit(false)
    }
    return <div>
        {localStorage.getItem('token') &&
        <main className="main bg-dark">
            {!edit && <div className="header">
                <h1>Welcome back<br /><span id="name">{user.firstName} {user.lastName}</span></h1>
                <button className="edit-button" onClick={(e) => handleEdit(e)}>Edit Name</button>
            </div>}
            {edit && <div className="header">
                <form onSubmit={(e) => updateForm(e)}>
                    <div className="input-wrapper">
                        <label htmlFor="firstName">first name</label>
                        <input type="text" id="firstName" value={firstName} onChange={(e) => setFirstName(e.target.value)}/>
                    </div>
                    <div className="input-wrapper">
                        <label htmlFor="lastName">last name</label>
                        <input type="lastName" id="lastName" value={lastName} onChange={(e) => setLastName(e.target.value)}/>
                    </div>
                    <button type="submit" className="sign-in-button">Save</button>
                    <button className="sign-in-button" onClick={(e) => cancelForm(e)}>Cancel</button>
                </form>
            </div>}
            <h2 className="sr-only">Accounts</h2>
            <section className="account">
                <div className="account-content-wrapper">
                <h3 className="account-title">Argent Bank Checking (x8349)</h3>
                <p className="account-amount">$2,082.79</p>
                <p className="account-amount-description">Available Balance</p>
                </div>
                <div className="account-content-wrapper cta">
                <button className="transaction-button" onClick={() => checkstate()}>View transactions</button>
                </div>
            </section>
            <section className="account">
                <div className="account-content-wrapper">
                <h3 className="account-title">Argent Bank Savings (x6712)</h3>
                <p className="account-amount">$10,928.42</p>
                <p className="account-amount-description">Available Balance</p>
                </div>
                <div className="account-content-wrapper cta">
                <button className="transaction-button">View transactions</button>
                </div>
            </section>
            <section className="account">
                <div className="account-content-wrapper">
                <h3 className="account-title">Argent Bank Credit Card (x8349)</h3>
                <p className="account-amount">$184.30</p>
                <p className="account-amount-description">Current Balance</p>
                </div>
                <div className="account-content-wrapper cta">
                <button className="transaction-button">View transactions</button>
                </div>
            </section>
        </main>}
        {!localStorage.getItem('token') && <Navigate to="/signin" replace={true} />}
    </div>
}

export default Profile
